Serie de fibonacci.

fib &lt;- function(n) {

  if (n == 1) {

    return(0)
  }
  else if(n == 2) {

    return(1)
  }
  else if(n &gt; 2) {

    return(fib(n - 1) + fib(n - 2))
  }

}


s_fib &lt;- function(m) {

    serie &lt;- vector("numeric", length = m)

    for (i in 1:m) {

        serie[i] &lt;- fib(i)
    }

    return(serie)
}

